    initOnlyDigits: function () {
        const $acceptOnlyDigits = $('.accept-only-digits');
        $acceptOnlyDigits.on('keydown', function (event) {
            var availableCodes = [8, 46, 86];
            var keyCode = event.which;
            if ($(this).data('exceptions')) {
                var exceptions = [parseInt($(this).data('exceptions'))];

                if ($(this).data('exceptions').length > 0) {
                    exceptions = $(this).data('exceptions').split(',').map(function (e) {
                        return +e;
                    });
                }

                $.merge(availableCodes, exceptions);
            }

            if (jQuery.inArray(keyCode, availableCodes) !== -1 ||
                (keyCode >= 35 && keyCode <= 40) ||
                (keyCode >= 48 && keyCode <= 57) ||
                (keyCode >= 96 && keyCode <= 105)
            ) {
                return;
            }
            event.preventDefault();
        });

        $acceptOnlyDigits.on('keyup', function (event) {
            var keyCode = event.which;
            if (keyCode === 86) {
                var value = ($(this).val());
                var charArray = value.split('');
                var hasIllegalCharacter = false;
                charArray.forEach(function (c) {
                    let code = c.charCodeAt(0);
                    if (
                        (code < 48 || code > 57)
                    ) {
                        hasIllegalCharacter = true;
                    }
                })
            }
            if (hasIllegalCharacter) {
                if (keyCode === 86) {
                    $(this).val('');
                }
            }
            event.preventDefault();
        });
    },

