    initStringFunctions: function () {
        String.prototype.toPersianDigits = function (str) {
            var b = str || this;
            for (var c = 48; c <= 57; c++) {
                var d = String.fromCharCode(c);
                var e = String.fromCharCode(c + 1728);
                b = b.replace(new RegExp(d.toString(), "g"), e.toString())
            }
            return b;
        };

        String.prototype.toPersianCurrency = function (str, currency) {
            str = str || this;
            currency = currency || 'ریال';
            var value = (parseInt(str, 10) + '.').replace(/(\d)(?=(\d{3})+\.)/g, '$1,');
            value = value.replace(/\./g, '').toPersianDigits();
            return value + ' ' + currency;
        };

        String.prototype.toEnglishDigits = function (str) {
            str = str || this;
            return str
                .replace(/۰/g, '0')
                .replace(/۱/g, '1')
                .replace(/۲/g, '2')
                .replace(/۳/g, '3')
                .replace(/۴/g, '4')
                .replace(/۵/g, '5')
                .replace(/۶/g, '6')
                .replace(/۷/g, '7')
                .replace(/۸/g, '8')
                .replace(/۹/g, '9');
        }
    },

    initThousandSeparator: function () {
        var sep = function () {
            (function () {
                // Currency

                var oldVal = $.fn.val;
                $.fn.val = function () {
                    var self = this;

                    var args = Array.prototype.slice.call(arguments);

                    if ($(self).hasClass('dk-currency')) {
                        if (arguments.length > 0) {
                            //set
                            return oldVal.apply(self, args);
                        }

                        //get
                        var result = oldVal.apply(self, args);
                        if (result) {
                            return window.toLatinDigits(result).replace(/\D/ig, '');
                        }
                        return result;
                    }
                    return oldVal.apply(self, args);
                };

                var format = function (val) {
                    var num = val.replace(/,/g, '');
                    return num.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,");
                };

                var currencyFormat = function (self) {
                    var num = format($(self).val());

                    $(self).val(num);
                };


                $('form.has-price').each(function (i, item) {
                    var form = $(item);
                    form.submit(function (e) {
                        e.preventDefault();
                        var dkCurrencies = $('.dk-currency', form);
                        dkCurrencies.each(function (j, jtem) {
                            jtem.value = jtem.value ? jtem.value.replace(/,/g, '') : null;
                        });
                        form.get(0).submit();
                    });
                });

                const $dkCurrency = $('.dk-currency');

                $dkCurrency.each(function (i, item) {
                    currencyFormat(item);
                });

                $dkCurrency.on("paste keyup focus change", function (event) {
                    if (event.which >= 37 && event.which <= 40) {
                        event.preventDefault();
                    }
                    currencyFormat(this);
                });

            })();
        };
        $(function () {
            sep();
        });
    },

    initTooltips: function () {
        let uiTooltip;

        document.onmouseover = makeTooltip;
        document.onscroll = removeTooltip;
        document.onmouseout = removeTooltip;

        function makeTooltip(e)
        {
            const tooltipAnchor = (
                e.target.closest('[data-ui-tooltip]') ||
                (e.target.dataset && e.target.dataset.uiTooltip) ||
                false
            );
            if (!tooltipAnchor) {
                return;
            }

            if (uiTooltip) {
                removeTooltip();
            }

            /** @param tooltipAnchor.dataset.uiTooltip */
            uiTooltip = showTooltip(tooltipAnchor, tooltipAnchor.dataset.uiTooltip);
        }

        function removeTooltip()
        {
            if (uiTooltip) {
                uiTooltip.remove();
                uiTooltip = false;
            }
        }

        function showTooltip(container, html)
        {
            const tooltipElem = document.createElement('div');

            tooltipElem.className = 'c-ui-tooltip';
            tooltipElem.innerHTML = html;
            document.body.append(tooltipElem);

            const containerPosition = container.getBoundingClientRect();
            const tooltipHalfWidth = tooltipElem.offsetWidth / 2;
            const containerHalfWidth = container.offsetWidth / 2;

            if (containerPosition.left + containerHalfWidth + tooltipHalfWidth >= document.body.clientWidth) {
                tooltipElem.classList.add('c-ui-tooltip--left');
                tooltipElem.style.left = containerPosition.left + 'px';
            } else if (containerPosition.left + containerHalfWidth - tooltipHalfWidth <= 0) {
                tooltipElem.classList.add('c-ui-tooltip--right');
                tooltipElem.style.left = containerPosition.left + 'px';
            } else {
                tooltipElem.style.left = containerPosition.left + containerHalfWidth + 'px';
            }

            if (containerPosition.top + containerPosition.height + tooltipElem.offsetHeight >= window.innerHeight) {
                tooltipElem.classList.add('c-ui-tooltip--top');
                tooltipElem.style.top = containerPosition.top - tooltipElem.offsetHeight + 'px';
            } else {
                tooltipElem.style.top = containerPosition.top + containerPosition.height + 'px';
            }

            tooltipElem.style.opacity = 1;

            return tooltipElem;
        }
    },

    initGAevents: function () {
        const eventCategory = window.gaEventCategory;

        if (!(eventCategory && document.querySelector('[class*="js-ga-"]'))) {
            return;
        }

        $(document).on('click', '.js-ga-click', fireGaClick);

        function fireGaClick(e)
        {
            const ga = window.ga;

            if (ga) {
                const target = this;

                if (!e.screenX) {
                    return;
                }

                let name = target.dataset.gaName || target.textContent.trim();

                if (!(name)) {
                    return;
                }

                submitGa(eventCategory, 'Clicks', name);
            }
        }

        function submitGa(category, action, name)
        {
            window.ga('gtm1.send', 'event', category, action, name, {
                nonInteraction: true
            });
        }
    },

