/*[PATH @digikala/supernova-digikala-marketplace/assets/local/js/controllers/slider/slider.js]*/
const Slider = {
    state: {
        slideIndex: 1,
    },
    init: function (){
        this.initHandleSlider();
        this.initGoToCurrentSlide();
    },

    initGoToCurrentSlide: function (){
        $('.js-slide-one').click(function (){
            Slider.currentSlide(1);
        })

        $('.js-slide-two').click(function (){
            Slider.currentSlide(2);
        })

        $('.js-slide-three').click(function (){
            Slider.currentSlide(3);
        })

        $('.js-slide-four').click(function (){
            Slider.currentSlide(4);
        })
    },

   initHandleSlider: function (){
       Slider.showSlides(Slider.state.slideIndex);
   },

    currentSlide: function (n){
        Slider.showSlides(Slider.state.slideIndex = n);
    },

    showSlides: function (n){
        var i;
        const slides = $('.js-slides');
        const dots = $('.js-dot');

        if (n > slides.length) {
            Slider.state.slideIndex = 1
        }
        if (n < 1) {
            Slider.state.slideIndex = slides.length
        }
        for (i = 0; i < slides.length; i++) {
            slides.eq(i).css('display', 'none');
        }

        // for (i = 0; i < dots.length; i++) {
        //     dots.eq(i).addClass("").removeClass('active');
        // }

        slides.eq(Slider.state.slideIndex-1).css('display', 'block');
        // dots.eq(Slider.state.slideIndex-1).addClass('active');

    },
}

$(function () {
    Slider.init();
});